    link:
      "https://www.facebook.com/glicoicreoVietnam/photos/a.166579417298554/352693692020458/?type=3",
    name: "Glico Icreo Vietnam",
    description:
      'HIỂU ĐÚNG VỀ DỊ ỨNG THỰC PHẨM Ở TRẺ SƠ SINH\n\nChiều hôm qua ngày 21/4/2019, Ông Hirano Yuzo, CEO của công ty SnB Distribution, đại diện phân phối độc quyền sản phẩm thực phẩm bổ sung dinh dưỡng sữa bột công thức Glico Icreo Nhật Bản tại Việt Nam đã đến thăm gia đình dược sĩ Lê Huy Dương, bố của cháu bé Lê Nam Phong. Ông Hirano rất xúc động khi thấy cháu bé đang hồi phục nhanh chóng và chia sẻ ông hết sức ấn tượng với kiến thức của anh Dương, đặc biệt là trong chủ đề dị ứng ở trẻ sơ sinh. \n\n Đồng thời, ông Hirano và anh Lê Huy Dương cũng đã trao đổi về những lưu ý khi sử dụng sữa bột cho trẻ, đặc biệt là trẻ dưới 1 tuổi:\n\n- Dị ứng cơ địa có thể thấy ở trẻ sơ sinh, cũng như ở người lớn, vì rất nhiều nguyên nhân khác nhau, như dị ứng đồ ăn, dị ứng nước, dị ứng do côn trùng cắn... Khi cho trẻ sử dụng bất cứ sản phẩm sữa bột nào nói riêng, và bất cứ loại sản phẩm thực phẩm nào nói chung, cha mẹ cũng cần lưu ý về tiền sử dị ứng của cha mẹ (Giống như anh Lê Huy Dương cũng dị ứng tôm và cua)\n\n- Cha mẹ cần luôn đọc kỹ hướng dẫn sử dụng trước khi cho con dùng các sản phẩm thực phẩm nói chung\n\n- Cha mẹ nên sử dụng một lượng nhỏ trước khi cho con dùng các sản phẩm thực phẩm lần đầu, khoảng 3 đến 5ml và đảm bảo luôn quan sát thật kỹ các phản ứng của trẻ trong khoảng 2 tiếng, đặc biệt không cho bé sử dụng thực phẩm lần đầu tiên ngay trước khi đi ngủ, vì sẽ rất khó quan sát trẻ vào ban đêm. Đối với những trẻ có cha mẹ hoặc anh chị em ruột có tiền sử dị ứng, cha mẹ nên cẩn trọng hơn và quan sát khi trẻ sử dụng sản phẩm lần đầu trong vòng 24 tiếng. Nếu trẻ có bất cứ biểu hiện nào lạ (mẩn đỏ, tiêu chảy, nôn trớ…) hãy đưa trẻ đến gặp bác sĩ ngay để được kiểm tra. \n\nNguyên là Giám đốc phụ trách quản lý chất lượng và sau đó là Giám đốc kinh doanh tại công ty Glico Icreo Nhật Bản, ông Hirano cũng khẳng định nhãn hàng luôn đặt chất lượng lợi ích và sức khỏe của trẻ lên hàng đầu, do đó:\n\n- Các sản phẩm Glico Icreo được phân phối chính hãng ở Việt Nam cũng chính là những sản phẩm đang được sử dụng tại nội địa Nhật Bản. Glico Icreo phân phối duy nhất một loại sản phẩm cho thị trường Nhật Bản và thị trường Việt Nam.\n\n- Sữa mẹ là thức ăn tốt nhất cho sức khỏe và sự phát triển của trẻ sơ sinh và trẻ nhỏ. Trong trường hợp cần bổ sung thêm các sản phẩm sữa khác, cha mẹ cần lưu ý đọc kỹ hướng dẫn sử dụng trước khi cho con dùng, và hiểu rõ cơ địa của trẻ, đồng thời cho trẻ thử sản phẩm trước khi sử dụng chính thức.\n \n- Với những bé không có cơ địa dị ứng với đạm sữa bò, đây là sản phẩm sữa bột với chất lượng tốt và cao cấp tại Nhật Bản, được bình chọn và nhận giải thưởng "Mẹ Nhật Tin Dùng" năm 2015.\n\nNgoài ra, nếu có bất cứ thắc mắc nào khác, xin vui lòng liên hệ Bộ Phận Hỗ Trợ và Tư Vấn Khách Hàng của chúng tôi tại Việt Nam với 2 hình thức:\n- Gọi điện tới tổng đài  tại Việt Nam 1900 5555 99\n- Gọi điện tới tổng đài tại Nhật Bản +81 120 964 369\n- Nhắn tin cho chúng tôi thông qua trang Facebook này của Glico Icreo Việt Nam\nXin chân thành cảm ơn!',
