    description:
      '🎶 ""Lắc lư để tinh anh \n🎶 Lắc lư để tiêu hóa...""\n\nBố Mẹ nào cũng biết: Vận động và dinh dưỡng phù hợp giúp thúc đẩy tiêu hóa tốt hơn, Bé sẽ có "Hệ tiêu hóa khỏe, trí não tinh anh". 🎓🎓🎓\n\n🎵 Hãy bật nhạc và lắc lư cùng bé với VŨ ĐIỆU BỤNG KHỎE - TINH ANH đang “gây sốt” cộng đồng bỉm sữa để con yêu vừa được vận động mạnh khỏe, Bố Mẹ vừa rinh thêm được rất nhiều phần quà vô cùng giá trị trong cuộc thi Dance Cover Vũ điệu Bụng khỏe - Tinh anh🎁🎁\n✨01 Giải Đặc biệt - SIÊU SAO VẬN ĐỘNG Bụng khỏe, Tinh anh với #5_TRIỆU_ĐỒNG và 03 tháng sử dụng sản phẩm Nội Địa Nhật Bản.\n✨ 02 Giải Nhất - SIÊU NHÍ LẮC LƯ với #2_TRIỆU_ĐỒNG và 02 tháng sử dụng sản phẩm Nội Địa Nhật Bản.\n✨ 03 Giải Nhì - SIÊU NHÍ TINH ANH với 01 tháng sử dụng sản phẩm Nội Địa Nhật Bản.\n\nSân chơi này dành cho Bố Mẹ và em bé từ 0-3 tuổi với thể lệ như sau:\n✅ Bước 1: Bố Mẹ quay một đoạn clip bé "vận động" theo nhịp nhạc của Vũ điệu Bụng khỏe - Tinh anh và đăng công khai trên tường Facebook cá nhân với hashtag #VŨ_ĐIỆU_BỤNG_KHOẺ_TINH_ANH #Hetieuhoakhoe_trinaotinhanh #GlicoIcreo\n+ Bố Mẹ có thể tải bài hát tại: http://bit.ly/VDBungKhoeTinhAnh\n✅ Bước 2: Gửi link bài dự thi về MNNC bằng cách bình luận kèm theo cảm nghĩ về MV Vũ điệu Bụng khỏe - Tinh anh dưới 1 trong 2 post này http://bit.ly/2DgAf9R hoặc https://goo.gl/Q9fM78\n✅ Bước 3: Kêu gọi like, share bài dự thi tại Facebook cá nhân.\n\nTiêu chí chấm bài dự thi:\n♦ 60% do Ban Tổ Chức chấm dựa trên nội dung của video\n♦ 40% tính trên lượt like và share\nBố mẹ tìm hiểu thêm thông tin chi tiết tại: http://bit.ly/NoteDanceCoverBungKhoe_TinhAnh\n\nThời gian tham dự: 12/11 - 18/12/2018\n\n#VẬN_ĐỘNG_CÙNG_BỐ #VŨ_ĐIỆU_BỤNG_KHOẺ_TINH_ANH \n#GlicoIcreo\n#Hetieuhoakhoe_trinaotinhanh, #NoiDiaNhatBan',
